title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o22653.m18 -> o22662.m14 -> o22653.m18
  o22662.m14 -> o22653.m18 -> o22662.m14
  o22662.m9 -> o22653.m18 -> o22662.m14 -> o22653.m18

features:
  - inheritance
  - overriding
  - method
  - polymorphism

